import { BrowserRouter as Router,Route,Switch } from "react-router-dom";
import Jizan from '../jizan.png';
import { Transition } from '@headlessui/react'
import { useState } from 'react'
import Guitar from './assets/guitar.png'

function Home (){
  const [count, setCount] = useState(0);
  const Box = (props) =>{
    return(
      <>
      <div className="top flex flex-col max-h-[50vh] w-full text-center justify-center  md:justify-center md:text-left">
            <h1 className="name text-5xl font-Libre w-full font-bold md:max-w-[500px] my-[1rem] text-[#e9948d] lg:lg:text-6xl lg:leading-snug">
              Hi. I'm Jizan Diaz Villafuerte</h1>
            <p className="font font-Libre mt-4 max-w-[400px] md:max-w-[7500px] text-[#333333] lg:text-2xl">
              I'm' a Front-End Developer specializing in HTML/CSS, JavaScript and ReactJS.
            </p>
          </div>
          <img src={Guitar} alt="" className="w-auto h-[50vh] object-contain lg:h-[65vh]"/>
      </>
    )
  }
    return(
        <div className="Container w-screen  h-[90vh] flex flex-col px-[2vw] items-center justify-center md:flex-row md:px-[10vw]">
          <Box></Box>

        </div>
    );
}




export default Home;
